import RestaurantComponent from './RestaurantComponent.js'
import {data} from './data/data.js'

export default function App() {
  console.log(data)
  return (
    <div className="App">
      <h1>Рестораны</h1>
      {data.map((item) => {
        <RestaurantComponent key={item.id} data={item.name, item.food-type} />
      })}
    </div>
  )
}
